const Header=(props)=>(
  <>
  <h1>{props.course}</h1>
  </>
)
const Part1=(props)=>(
  <>
   <p>
      {props.name} {props.exercises}
    </p>
  </>
)
const Part2=(props)=>(
  <>
  <p>
    {props.part2} {props.exercises2}
  </p>
  </>
)
const Part3=(props)=>(
  <>
  <p>
  {props.part3} {props.exercises3}
  </p>
  </>
)
const Content=(props)=>(
      <>
      {console.log(props)}
      <Part1 name={props.part1.name} exercises1={props.exercises}/>
      <Part2 part2={props.part2} exercises2={props.exercises2}/>
      <Part3 part3={props.part3} exercises3={props.exercises3}/>
  </>
)
const Total=(p)=>(
  <p>Number of exercises {p.ex1+p.ex2+p.ex3}</p>
)

const App=()=>{
  const course='Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  console.log(part1)
  // const part1='Fundamentals of React'
  // const exercises1=10
  const part2='Using props to pass data'
  const exercises2=7
  const part3='State of a component'
  const exercises3=14

  return(
    <div>
      <Header 
      course={course}
      />
      <Content part1={part1}
      part2={part2}
      part3={part3}
      exercises2={exercises2}
      exercises3={exercises3}
      />
      <Total
      ex1={part1.exercises}
      ex2={exercises2}
      ex3={exercises3}
      />
    </div>
  )
}
export default App
